import { useState } from 'react';
import './App.css';
import './Navbar.css';
import Navbar from './Navbar.js';

function App() {
  return (
    <>
      <Header />
      <div className="App">
        <p>This should just be plain text.</p>
      </div>
    </>
  );
}

function Header() {
  return (
  <>
  <section id="header">
    <div id="name-wrapper">John Collins</div>
    <div id="socials-wrapper">
      <div className="socials-buffer" />
      <div id="link-wrapper">GitHub: JohnGJCollins</div>
      <div id="link-wrapper">LinkedIn: JohnGJCollins</div>
      <div className="socials-buffer" />
    </div>
  </section>
  <Navbar />
  </>
  );
}

export default App;
